Jednostrano od Poslodavca uz obaveštenje od šezdeset (60) dana:
• Poslodavac ima ekonomske, tehničke ili organizacione razloge za takav potez;
• Zaposleni više nije sposoban da obavlja zadatke rada;
• Zaposleni je odgovoran za teške prekršaje unutrašnjih pravila;
• Zaposleni nije ispunio radne zadatke na zadovoljavajući način i nije se poboljšao čak ni nakon upozorenja Poslodavca. Jednostrano od Zaposlenog/ie:
• Uz pismeno obaveštenje upućeno Poslodavcu najmanje trideset (30) dana pre datuma kada se namerava da se prekine Ugovor. Član 9: Rešavanje Sporova
